INSERT INTO `opesc_modification` VALUES (1, 9, 'Facebook Open Graph Tags for Opencart v3 - v1.1', 'facebook_open_graph_tags_for_opencart_v3', 'agatha65.com', '1.1', 'http://www.agatha65.com', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n    <modification>\r\n        <name>Facebook Open Graph Tags for Opencart v3 - v1.1</name>\r\n		<code>facebook_open_graph_tags_for_opencart_v3</code>\r\n        <version>1.1</version>\r\n        <author>agatha65.com</author>\r\n		<link>http://www.agatha65.com</link>\r\n		<file path=\"system/library/document.php\">\r\n		    <operation>\r\n                <search><![CDATA[\r\n				private $scripts = array();\r\n                ]]></search>\r\n                <add position=\"after\"><![CDATA[\r\n				private $ogmetas = array();\r\n                ]]></add>\r\n            </operation>\r\n			<operation>\r\n                <search><![CDATA[\r\n				public function addStyle($href, $rel = \'stylesheet\', $media = \'screen\') {\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n				public function addOGMeta($meta_name, $content) {\r\n		            $this->ogmetas[] = array(\r\n		        	\'meta_name\'  => $meta_name,\r\n	        		\'content\'   => $content\r\n	            	);\r\n            	}\r\n				public function getOGMeta() {\r\n            		return $this->ogmetas;\r\n            	}\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n		<file path=\"catalog/controller/common/header.php\">\r\n		    <operation>\r\n                <search><![CDATA[\r\n				$data[\'language\'] = $this->load->controller(\'common/language\');\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n				// For page specific og tags\r\n				if (isset($this->request->get[\'route\'])) {\r\n					if (isset($this->request->get[\'product_id\'])) {\r\n						$class = \'-\' . $this->request->get[\'product_id\'];\r\n						$this->document->addOGMeta(\'property=\"og:type\"\', \'product\');\r\n					} elseif (isset($this->request->get[\'path\'])) {\r\n						$class = \'-\' . $this->request->get[\'path\'];\r\n					} elseif (isset($this->request->get[\'manufacturer_id\'])) {\r\n						$class = \'-\' . $this->request->get[\'manufacturer_id\'];\r\n					} elseif (isset($this->request->get[\'information_id\'])) {\r\n						$class = \'-\' . $this->request->get[\'information_id\'];\r\n						$this->document->addOGMeta(\'property=\"og:type\"\', \'article\');\r\n					} else {\r\n						$class = \'\';\r\n					}\r\n					$data[\'class\'] = str_replace(\'/\', \'-\', $this->request->get[\'route\']) . $class;\r\n				} else {\r\n					$data[\'class\'] = \'common-home\';\r\n					$this->document->addOGMeta(\'property=\"og:type\"\', \'website\');\r\n				}\r\n				$this->load->model(\'tool/image\');\r\n				$data[\'logo_meta\'] = str_replace(\' \', \'%20\', $this->model_tool_image->resize($this->config->get(\'config_logo\'), 300, 300));\r\n				$data[\'ogmeta\'] = $this->document->getOGMeta();\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n		<file path=\"catalog/view/theme/*/template/common/header.twig\">\r\n		    <operation>\r\n                <search><![CDATA[\r\n				</head>\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n				<meta property=\"og:title\" content=\"{{ title }}\" >\r\n                <meta property=\"og:description\" content=\"{{ description ? description : \'\' }}\" >\r\n				{% if class == \'common-home\' %}\r\n				<meta property=\"og:url\" content=\"{{ base }}\" >\r\n				{% endif %}\r\n				{% if (\'product-product\' not in class) and (\'product-category\' not in class) and (\'product-manufacturer-info\' not in class) %}\r\n				<meta property=\"og:image\" content=\"{{ logo_meta }}\" >\r\n				<meta property=\"og:image:width\" content=\"300\" >\r\n				<meta property=\"og:image:height\" content=\"300\" >\r\n				{% endif %}\r\n				<meta property=\"og:site_name\" content=\"{{ name }}\" >\r\n				{% for meta_tag in ogmeta %}\r\n                <meta {{ meta_tag.meta_name}} content=\"{{ meta_tag.content }}\" >\r\n                {% endfor %}\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n		<file path=\"catalog/controller/product/product.php\">\r\n		    <operation>\r\n                <search><![CDATA[\r\n				$this->document->addLink($this->url->link(\'product/product\', \'product_id=\' . $this->request->get[\'product_id\']), \'canonical\');\r\n                ]]></search>\r\n                <add position=\"after\"><![CDATA[\r\n		    	$this->document->addOGMeta(\'property=\"og:url\"\', $this->url->link(\'product/product\', \'product_id=\' . $this->request->get[\'product_id\']) );\r\n                ]]></add>\r\n            </operation>\r\n		    <operation>\r\n                <search><![CDATA[\r\n				$results = $this->model_catalog_product->getProductImages($this->request->get[\'product_id\']);\r\n                ]]></search>\r\n                <add position=\"after\"><![CDATA[\r\n				if ($product_info[\'image\']) {\r\n					$this->document->addOGMeta(\'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($product_info[\'image\'], 600, 315)) );\r\n					$this->document->addOGMeta(\'property=\"og:image:width\"\', \'600\');\r\n					$this->document->addOGMeta(\'property=\"og:image:height\"\', \'315\');\r\n			    } else {\r\n		    		$this->document->addOGMeta( \'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($this->config->get(\'config_logo\'), 300, 300)) );\r\n					$this->document->addOGMeta(\'property=\"og:image:width\"\', \'300\');\r\n					$this->document->addOGMeta(\'property=\"og:image:height\"\', \'300\');\r\n	     		}\r\n				foreach ($results as $result) {\r\n			    	$this->document->addOGMeta( \'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($result[\'image\'], 600, 315)) );\r\n					$this->document->addOGMeta(\'property=\"og:image:width\"\', \'600\');\r\n					$this->document->addOGMeta(\'property=\"og:image:height\"\', \'315\');\r\n       			}\r\n                ]]></add>\r\n            </operation>\r\n			<operation>\r\n                <search><![CDATA[\r\n				if ($product_info[\'minimum\']) {\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n				$meta_price = ( $data[\'special\'] != false) ? $data[\'special\'] : $data[\'price\'] ;\r\n				$meta_price = trim(trim(($data[\'special\'] != false) ? $data[\'special\'] : $data[\'price\'], $this->currency->getSymbolLeft($this->session->data[\'currency\'])), $this->currency->getSymbolRight($this->session->data[\'currency\']));\r\n				$decimal_point_meta_price = $this->language->get(\'decimal_point\') ? $this->language->get(\'decimal_point\') : \'.\';\r\n                $thousand_point_meta_price = $this->language->get(\'thousand_point\')? $this->language->get(\'thousand_point\') : \' \';\r\n                $meta_price = str_replace($thousand_point_meta_price, \'\', $meta_price);\r\n                if ( $decimal_point_meta_price != \'.\' ) {\r\n                  $meta_price = str_replace($decimal_point_meta_price, \'.\', $meta_price);\r\n                }\r\n                $meta_price = number_format((float)$meta_price, 2, \'.\', \'\');\r\n				\r\n				$this->document->addOGMeta(\'property=\"product:price:amount\"\', $meta_price);\r\n				$this->document->addOGMeta(\'property=\"product:price:currency\"\', $this->session->data[\'currency\']);\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n		<file path=\"catalog/controller/product/category.php\">\r\n		    <operation>\r\n                <search><![CDATA[\r\n				$pagination = new Pagination();\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n		    	$this->document->addOGMeta(\'property=\"og:url\"\', $this->url->link(\'product/category\', \'path=\' . $category_info[\'category_id\'] . ( ($page != 1) ? \'&page=\'. $page : \'\' ), true) );\r\n                ]]></add>\r\n            </operation>\r\n		    <operation>\r\n                <search><![CDATA[\r\n				if ($category_info[\'image\']) {\r\n                ]]></search>\r\n                <add position=\"after\"><![CDATA[\r\n				if ( ($this->config->get(\'theme_\' . $this->config->get(\'config_theme\') . \'_image_category_width\') < 300) || ($this->config->get(\'theme_\' . $this->config->get(\'config_theme\') . \'_image_category_height\') < 300) ) {\r\n				    $this->document->addOGMeta( \'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($category_info[\'image\'], 300, 300)) );\r\n					$this->document->addOGMeta(\'property=\"og:image:width\"\', \'300\');\r\n					$this->document->addOGMeta(\'property=\"og:image:height\"\', \'300\');\r\n				} else { \r\n				    $this->document->addOGMeta( \'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($category_info[\'image\'], $this->config->get(\'theme_\' . $this->config->get(\'config_theme\') . \'_image_category_width\'), $this->config->get(\'theme_\' . $this->config->get(\'config_theme\') . \'_image_category_height\'))) );\r\n					$this->document->addOGMeta(\'property=\"og:image:width\"\', $this->config->get(\'theme_\' . $this->config->get(\'config_theme\') . \'_image_category_width\'));\r\n					$this->document->addOGMeta(\'property=\"og:image:height\"\', $this->config->get(\'theme_\' . $this->config->get(\'config_theme\') . \'_image_category_height\'));\r\n				}\r\n                ]]></add>\r\n            </operation>\r\n			<operation>\r\n                <search><![CDATA[\r\n				$data[\'thumb\'] = \'\';\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n		    	$this->document->addOGMeta( \'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($this->config->get(\'config_logo\'), 300, 300)) );\r\n				$this->document->addOGMeta(\'property=\"og:image:width\"\', \'300\');\r\n				$this->document->addOGMeta(\'property=\"og:image:height\"\', \'300\');\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n		<file path=\"catalog/controller/product/manufacturer.php\">\r\n		    <operation>\r\n                <search><![CDATA[\r\n				$pagination = new Pagination();\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n				$this->document->addOGMeta(\'property=\"og:url\"\', $this->url->link(\'product/manufacturer/info\', \'manufacturer_id=\' . $this->request->get[\'manufacturer_id\'] . ( ($page != 1) ? \'&page=\'. $page : \'\' ), true) );\r\n                ]]></add>\r\n            </operation>\r\n		    <operation>\r\n                <search><![CDATA[\r\n				if ($manufacturer_info) {\r\n                ]]></search>\r\n                <add position=\"after\"><![CDATA[\r\n				  if ($this->request->server[\'HTTPS\']) {\r\n			        $server = $this->config->get(\'config_ssl\');\r\n		          } else {\r\n		            $server = $this->config->get(\'config_url\');\r\n	              }\r\n				if ($manufacturer_info[\'image\']) {\r\n				  $this->document->addOGMeta(\'property=\"og:image\"\', str_replace(\' \', \'%20\', $server . \'image/\' . $manufacturer_info[\'image\']) );\r\n				} else {\r\n		    	  $this->document->addOGMeta(\'property=\"og:image\"\', str_replace(\' \', \'%20\', $this->model_tool_image->resize($this->config->get(\'config_logo\'), 300, 300)) );\r\n				  $this->document->addOGMeta(\'property=\"og:image:width\"\', \'300\');\r\n				  $this->document->addOGMeta(\'property=\"og:image:height\"\', \'300\');\r\n				}\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n		<file path=\"catalog/controller/information/information.php\">\r\n			<operation>\r\n                <search><![CDATA[\r\n				$this->document->setTitle($information_info[\'meta_title\']);\r\n                ]]></search>\r\n                <add position=\"before\"><![CDATA[\r\n				$this->document->addOGMeta(\'property=\"og:url\"\', $this->url->link(\'information/information\', \'information_id=\' .  $information_id) );\r\n                ]]></add>\r\n            </operation>\r\n		</file>\r\n    </modification>', 1, '2020-05-01 09:14:41');
INSERT INTO `opesc_modification` VALUES (2, 10, 'Todas as URLs amig√°veis para OpenCart 3.0.x', 'todas-urls-amigaveis', 'OpenCart Brasil', '3.0.1', 'http://www.opencartbrasil.com.br', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<modification>\r\n  <name>Todas as URLs amig√°veis para OpenCart 3.0.x</name>\r\n  <code>todas-urls-amigaveis</code>\r\n  <version>3.0.1</version>\r\n  <author>OpenCart Brasil</author>\r\n  <link>http://www.opencartbrasil.com.br</link>\r\n  <file path=\"catalog/controller/startup/seo_url.php\">\r\n    <operation>\r\n      <search><![CDATA[class ControllerStartupSeoUrl extends Controller {]]></search>\r\n      <add position=\"after\"><![CDATA[\r\n        private $new_urls = array(\r\n            \'common/home\' => \'\',\r\n            \'account/account\' => \'conta/minha-conta\',\r\n            \'account/wishlist\' => \'conta/lista-desejos\',\r\n            \'account/register\' => \'conta/cadastro\',\r\n            \'account/login\' => \'conta/acessar\',\r\n            \'account/forgotten\' => \'conta/solicitar-senha\',\r\n            \'account/edit\' => \'conta/informacoes\',\r\n            \'account/password\' => \'conta/modificar-senha\',\r\n            \'account/address\' => \'conta/enderecos\',\r\n            \'account/address/edit\' => \'conta/enderecos/editar\',\r\n            \'account/address/delete\' => \'conta/enderecos/excluir\',\r\n            \'account/address/add\' => \'conta/enderecos/cadastro\',\r\n            \'account/reward\' => \'conta/pontos\',\r\n            \'account/logout\' => \'conta/sair\',\r\n            \'account/order\' => \'conta/historico\',\r\n            \'account/order/info\' => \'conta/historico/informacoes\',\r\n            \'account/order/reorder\' => \'conta/historico/refazer\',\r\n            \'account/newsletter\' => \'conta/informativo\',\r\n            \'account/download\' => \'conta/downloads\',\r\n            \'account/transaction\' => \'conta/transacoes\',\r\n            \'account/recurring\' => \'conta/assinaturas\',\r\n            \'account/return\' => \'conta/devolucoes\',\r\n            \'account/return/add\' => \'conta/devolucoes/cadastro\',\r\n            \'account/return/success\' => \'conta/devolucoes/confirmacao\',\r\n            \'account/voucher\' => \'conta/vale-presentes/comprar\',\r\n            \'account/voucher/success\' => \'conta/vale-presentes/confirmacao\',\r\n            \'account/tracking\' => \'conta/afiliados/gerador-links\',\r\n            \'account/affiliate/edit\' => \'conta/afiliados/editar\',\r\n            \'affiliate/register\' => \'afiliados/cadastro\',\r\n            \'affiliate/login\' => \'afiliados/acessar\',\r\n            \'checkout/cart\' => \'carrinho\',\r\n            \'checkout/checkout\' => \'carrinho/finalizar\',\r\n            \'checkout/success\' => \'carrinho/finalizar/confirmacao\',\r\n            \'information/contact\' => \'contato\',\r\n            \'information/contact/success\' => \'contato/enviado\',\r\n            \'information/sitemap\' => \'mapa-site\',\r\n            \'product/special\' => \'promocoes\',\r\n            \'product/manufacturer\' => \'marcas\',\r\n            \'product/compare\' => \'comparar-produtos\',\r\n            \'product/search\' => \'busca\'\r\n        );\r\n      ]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search><![CDATA[$this->request->get[\'route\'] = \'error/not_found\';]]></search>\r\n      <add position=\"replace\"><![CDATA[\r\n        if (in_array($this->request->get[\'_route_\'], $this->new_urls)) {\r\n            $this->request->get[\'route\'] = array_search($this->request->get[\'_route_\'], $this->new_urls);\r\n        } else {\r\n            $this->request->get[\'route\'] = \'error/not_found\';\r\n        }\r\n      ]]></add>\r\n    </operation>\r\n    <operation>\r\n      <search index=\"1\"><![CDATA[unset($data[$key]);]]></search>\r\n      <add position=\"replace\"><![CDATA[\r\n            unset($data[$key]);\r\n        } else {\r\n            $this->new_urls = array_flip($this->new_urls);\r\n            if (in_array($data[\'route\'], $this->new_urls)) {\r\n                $url = \'/\' . array_search($data[\'route\'], $this->new_urls);\r\n            }\r\n            $this->new_urls = array_flip($this->new_urls);\r\n      ]]></add>\r\n    </operation>\r\n  </file>\r\n</modification>', 1, '2020-05-01 09:14:45');
INSERT INTO `opesc_modification` VALUES (3, 11, 'UltraImageManager', 'UltraImageManager', 'High as a Kite', '3.0', 'http://www.opencart.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\r\n<modification>\r\n    <name>UltraImageManager</name>\r\n    <code>UltraImageManager</code>\r\n    <version>3.0</version>\r\n    <author>High as a Kite</author>\r\n    <link>http://www.opencart.com</link>\r\n    \r\n    \r\n    <!-- Extension based on opencart version 2 of this link https://www.opencart.com/index.php?route=marketplace/extension/info&extension_id=21888\r\n    It was tested only in Opencart 3.0.3.2, but it should work on all Opencart 3.x\r\n    Its very important make a backup of file admin/view/javascript/common.js, because this extension overwrite the original file\r\n    If you already uploaded and didn\'t make the backup, just download the file common.js from an original opencart3.zip at official site -->\r\n	\r\n    <file path=\"admin/view/template/catalog/product_form.twig\">\r\n        <operation>\r\n            <search><![CDATA[{{ footer }}]]></search>\r\n            <add position=\"before\"><![CDATA[\r\n                  <!-- input Last Folder Remember -->\r\n                <input type=\"hidden\" value=\"{{ last_folder }}\" id=\"last-folder\">\r\n             <!-- Multiple images select and insert into product form  -->\r\n<script>\r\n  $(document).ready(function() {\r\n\r\n    // Green button - Insert images into form - default order \r\n    $(document).on(\'click\', \'#multiple-insert\', function() {\r\n\r\n        var images = [];\r\n        $(\'#image-to-select:checked\').each(function(i){\r\n          images[i] = $(this).val();\r\n        });\r\n   \r\n        $(\'#input-image\').val(images[0]);\r\n        $(\'#thumb-image img\').attr(\'src\', \'../image/\' + images[0]).css(\'max-width\', \'100px\');\r\n\r\n        for(var i = 0; i < images.length-1; i++) {\r\n          addImage();\r\n          $(\'#input-image\' + i).val(images[i+1]);\r\n          $(\'#thumb-image\' + i + \' img\').attr(\'src\', \'../image/\' + images[i+1]).css(\'max-width\', \'100px\');\r\n        }\r\n        \r\n        $(\'#modal-image\').modal(\'hide\');\r\n\r\n    })\r\n  });\r\n\r\n\r\n  // Adding images while choosing main image\r\n  $(document).ready(function() {\r\n\r\n      $(document).on(\'click\', \'#select-main\', function () {\r\n      \r\n      var main_image = $(this).parent().find(\'input\').val();\r\n\r\n      // Getting checked images\r\n      var images = [];\r\n        $(\'#image-to-select:checked\').each(function(i){\r\n          images[i] = $(this).val();\r\n        });\r\n\r\n        // Remove main image from array of checked ones\r\n        var index = images.indexOf(main_image);\r\n        if (index > -1) {\r\n          images.splice(index, 1);\r\n        }\r\n        console.log(images + images.length)\r\n\r\n        // Adding main image into form\r\n        $(\'#input-image\').val(main_image);\r\n        $(\'#thumb-image img\').attr(\'src\', \'../image/\' + main_image).css(\'max-width\', \'100px\');\r\n        \r\n\r\n        // Additional images to form\r\n        if(images.length === 1) {\r\n           addImage();\r\n          $(\'#input-image0\').val(images[0]);\r\n          $(\'#thumb-image0\' + \' img\').attr(\'src\', \'../image/\' + images[0]).css(\'max-width\', \'100px\');\r\n\r\n        } else {\r\n          for(var i = 0; i <= images.length-1; i++) {\r\n\r\n            addImage();\r\n            $(\'#input-image\' + i).val(images[i]);\r\n            $(\'#thumb-image\' + i + \' img\').attr(\'src\', \'../image/\' + images[i]).css(\'max-width\', \'100px\');\r\n          }          \r\n        }\r\n        $(\'#modal-image\').modal(\'hide\');\r\n    });\r\n  });\r\n</script>\r\n            ]]></add>\r\n        </operation>\r\n    </file>  \r\n\r\n    <file path=\"admin/controller/catalog/product.php\">\r\n      <operation>\r\n        <search><![CDATA[protected function getForm() {]]></search>\r\n        <add position=\"after\"><![CDATA[\r\n        if(isset($this->session->data[\'last_folder\'])) {\r\n              $data[\'last_folder\'] = $this->session->data[\'last_folder\'];\r\n            } else {\r\n              $data[\'last_folder\'] = \'\';\r\n            }\r\n          ]]></add>\r\n      </operation>\r\n    </file>\r\n\r\n    <file path=\"admin/view/template/common/filemanager.twig\">\r\n      <operation>\r\n        <search><![CDATA[<button type=\"button\" data-toggle=\"tooltip\" title=\"{{ button_delete }}\" id=\"button-delete\" class=\"btn btn-danger\"><i class=\"fa fa-trash-o\"></i></button>]]></search>\r\n        <add position=\"after\"><![CDATA[\r\n           <button type=\"buton\" data-toggle=\"tooltip\" title=\"Inserir imagens selecionadas\" id=\"multiple-insert\" class=\"btn btn-success\"><i class=\"fa fa-files-o\"></i></button>\r\n           <i class=\"fa fa-question-circle\" data-toggle=\"tooltip\" title=\"O bot√£o verde na parte superior do gerenciador de arquivos adiciona todas as imagens selecionadas. Sendo primeira imagem definida como capa e outras imagens adicionais. O bot√£o de [+] abaixo de cada imagem, definide a escolhida como capa e as demais selecionadas como adicionais.\" data-placement=\"bottom\"></i>\r\n          ]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<div id=\"filemanager\" class=\"modal-dialog modal-lg\">]]></search>\r\n        <add position=\"replace\"><![CDATA[<div id=\"filemanager\" class=\"modal-dialog modal-lg\" style=\"width:90%\">]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<input type=\"checkbox\" name=\"path[]\" value=\"{{ image.path }}\" />]]></search>\r\n        <add position=\"replace\"><![CDATA[<input type=\"checkbox\" name=\"path[]\" value=\"{{ image.path }}\" id=\"image-to-select\" />]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[{% for image in images|batch(4) %}]]></search>\r\n        <add position=\"replace\"><![CDATA[{% for image in images|batch(6) %}]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[<div class=\"col-sm-3 col-xs-6 text-center\">]]></search>\r\n        <add position=\"replace\"><![CDATA[<div class=\"col-sm-2 col-xs-6 text-center\">]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search index=\"0,2,3\"><![CDATA[{{ image.name }}]]></search>\r\n        <add position=\"after\"><![CDATA[\r\n           <button id=\"select-main\" class=\"btn btn-primary btn-xs\" title=\"Adicionar como imagem capa\"> <i class=\"fa fa-plus-square\"></i></button>\r\n        ]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[$(\'a.directory\').on(\'click\', function(e) {]]></search>\r\n        <add position=\"replace\" offset=\"4\"><![CDATA[\r\n          $(\'a.directory\').on(\'click\', function(e) {\r\n            e.preventDefault();\r\n\r\n            // Storing last folder into local storage\r\n            localStorage.setItem(\'lastFolder\', $(this).attr(\'href\'));\r\n\r\n            $(\'#modal-image\').load($(this).attr(\'href\'));\r\n          });\r\n        ]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[$(\'.pagination a\').on(\'click\', function(e) {]]></search>\r\n        <add position=\"replace\" offset=\"4\"><![CDATA[\r\n          $(\'.pagination a\').on(\'click\', function(e) {\r\n            e.preventDefault();\r\n            \r\n            // Storing last folder and page into local storage\r\n            localStorage.setItem(\'lastFolder\', $(this).attr(\'href\'));\r\n\r\n            $(\'#modal-image\').load($(this).attr(\'href\'));\r\n          });\r\n        ]]></add>\r\n      </operation>\r\n\r\n      <operation>\r\n        <search><![CDATA[$(\'#button-parent\').on(\'click\', function(e) {]]></search>\r\n        <add position=\"replace\" offset=\"4\"><![CDATA[\r\n          $(\'#button-parent\').on(\'click\', function(e) {\r\n            e.preventDefault();\r\n\r\n            // Storing last folder into local storage\r\n           localStorage.setItem(\'lastFolder\', $(this).attr(\'href\'));\r\n            \r\n            $(\'#modal-image\').load($(this).attr(\'href\'));\r\n          });\r\n        ]]></add>\r\n      </operation>\r\n    </file>\r\n\r\n    <file path=\"admin/controller/common/filemanager.php\">\r\n      <operation>\r\n        <search><![CDATA[$images = array_splice($images, ($page - 1) * 16, 16);]]></search>\r\n        <add position=\"replace\"><![CDATA[$images = array_splice($images, ($page - 1) * 18, 18);]]></add>\r\n      </operation>\r\n      <operation>\r\n        <search><![CDATA[$pagination->limit = 16;]]></search>\r\n        <add position=\"replace\"><![CDATA[$pagination->limit = 18;]]></add>\r\n      </operation>\r\n       <operation>\r\n        <search><![CDATA[$directory = rtrim(DIR_IMAGE . \'catalog/\' . $this->request->get[\'directory\'], \'/\');]]></search>\r\n        <add position=\"after\"><![CDATA[\r\n          // Store last folder into session\r\n          $this->session->data[\'last_folder\'] = $this->request->get[\'directory\'];\r\n      ]]></add>\r\n      </operation>     \r\n    </file>\r\n</modification>', 1, '2020-05-15 11:35:08');
